import * as React from "react";

import { Props as BaseProps } from 'one-ui';

export interface Props extends BaseProps {
}

export const Layout = (props: Props) => {
  const {
    style,
    className = 'ov-layout',
    children,
  } = props;

  return (
    <div
      style={style}
      className={className}
    >
      {children}
    </div>
  );
};
